import React from 'react';

const Home: React.FC = () => {
    return (
        <div>
            <h1>Welcome to My Portfolio</h1>
            <p>This is the main page of my portfolio website.</p>
            <p>Here you can find information about my projects, skills, and experience.</p>
        </div>
    );
};

export default Home;
